import React, { Component } from 'react';
import { withStyles, Typography} from '@material-ui/core';
import style from './style';

class Layout extends Component {
  render() {
    const { classes } = this.props;
    return (
      // <div className={classes.container}>
      //   <Typography variant='h5'>Login Screen</Typography>
      // </div>
      <Container maxWidth="xs">
      <CssBaseline />
      <div className={classes.container}>
        {/* <Avatar className={classes.avatar}>
          <LockOutlinedIcon />
        </Avatar> */}
        <div>
          {/* <img src="images/1.png" className={classes.image} /> */}
        </div>
        <Typography
          component="h1"
          variant="h5"
          className={classes.Typography}
        >
          Sign In
        </Typography>
        <form className={classes.from} noValidate>
          <TextField
            className={classes.textField}
            margin="normal"
            fullWidth
            variant="outlined"
            placeholder="Enter Your Password"
            autoComplete="email"
            InputProps={{
              startAdornment: (
                <InputAdornment className={classes.svg} position="start">
                  <AccountCircle />
                </InputAdornment>
              )
            }}
          />

          <TextField
            className={classes.textField}
            margin="normal"
            fullWidth
            type="password"
            variant="outlined"
            placeholder="Enter Your Password"
            InputProps={{
              startAdornment: (
                <InputAdornment className={classes.svg} position="start">
                  <LockIcon />
                </InputAdornment>
              )
            }}
          />

          <FormControlLabel
            control={<Checkbox value="remember" color="primary" />}
            label="Remember me"
          />

          <Link href="#" variant="body2" className={classes.forget}>
            
          </Link>

          <Button
            type="submit"
            fullWidth
            variant="contained"
            className={classes.btnsubmit}
          >
            Sign In
          </Button>
          <Button
            type="submit"
            fullWidth
            variant="contained"
            className={classes.btnsubmit}
          >
            Create New Account
          </Button>
        </form>
      </div>
    </Container>
    );
  }
}

export default withStyles(style)(Layout);
